INSERT INTO `ts_settings` VALUES ('8', '实时查询SQL', 'select \n t_date,decode(f_code,\'000010\',\'110007\',f_code)f_code,s_type,s_symbol,\n decode(s_exchange,\'9\',\'6\',s_exchange)s_exchange, decode(s_hld_invest_type,\'3\',\'1\',\'4\',\'a\',\'5\',\'b\',\'6\',\'a\',\'1\')s_hld_invest_type, \n s_hld_position, sum(n_amount)n_amount  ,0 n_table \n from t_fund_hlddetail f \n where f.t_date = to_date(?,\'yyyy-mm-dd\') \n and s_type in (\'B\',\'E\',\'F\')\ngroup by t_date,f_code,s_type,s_symbol,s_exchange,s_hld_invest_type,s_hld_position', '实时和恒生校对：实时查询SQL');
INSERT INTO `ts_settings` VALUES ('9', '恒生查询SQL', 'select \n t_date,f_code,s_type,s_symbol,\n s_exchange,s_hld_invest_type,s_hld_position, \n sum(n_amount) n_amount,1  n_table \n from ( \n select \n to_date(hld.l_date,\'yyyy-mm-dd\') t_date, \n fi.vc_fund_code  f_code, \n decode(si.c_asset_class,\'2\',\'E\',\'3\',\'B\',\'4\',\'F\') s_type, \n si.vc_report_code s_symbol,\n si.c_market_no s_exchange,   \n hld.c_invest_type s_hld_invest_type,   \n hld.c_position_flag s_hld_position,  \n  hld.l_current_amount n_amount   \n from tfundstock hld,tfundinfo fi,tstockinfo si  \n  where   \n hld.l_fund_id = fi.l_fund_id   \n and hld.vc_inter_code = si.vc_inter_code  \nand hld.l_current_amount >0\n  and hld.l_date = ?   \n and si.c_asset_class in (\'2\',\'3\',\'4\')   \n )  \n group by t_date,f_code,s_type,s_symbol,s_exchange,s_hld_invest_type,s_hld_position ', '实时和恒生校对：恒生查询SQL');
INSERT INTO `ts_settings` VALUES ('10', '校对结果SQL', 'insert into t_check_hlddetail_fm   (  \n  t_date,f_code,s_type, s_exchange,s_symbol, \n  s_hld_invest_type,s_hld_position,n_amount_real, \n  n_amount_hs,n_amount_dif,s_flag,S_IS_NEW \n  )  values(?,?,?,?, \n  ?,?,?,?,  \n ?,?,?,?)\n ', '实时和恒生校对：校对结果SQL');
